			{
				["targetkind"] = "npc",
				["targetid"] = 61581,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "Our men are accustomed to fighting with maces and clubs. Unfortunatly, we have little time for customs.",
				["questid"] = 30954,
				["targetname"] = "Ogo the Younger",
				["complete"] = "I will see to it that these are properly distributed. What's more - I'll make sure our blacksmiths get a rest. Niuzao knows they deserve it.",
