			{
				["targetkind"] = "npc",
				["targetid"] = 61580,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "",
				["questid"] = 30952,
				["targetname"] = "Ogo the Elder",
				["complete"] = "You fight like you are one of us.",
			}, -- [33]
			{
				["targetkind"] = "npc",
				["targetid"] = 61585,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "",
				["questid"] = 30953,
				["targetname"] = "Yak-Keeper Kyana",
				["complete"] = "In times like these, we must trust in the power and protection of Niuzao. Should things get any worse, he will protect us.\n\nHe always does.",
