			{
				["questid"] = 33134,
				["targetid"] = 64029,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "May these charms bring you great luck, $N.",
				["targetkind"] = "npc",
				["targetname"] = "Elder Lin",
				["complete"] = "May the stars smile upon you, $N.",
			}, -- [2]
			{
				["questid"] = 33229,
				["targetid"] = 73691,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "",
				["targetkind"] = "npc",
				["targetname"] = "Chromie",
				["complete"] = "<The tiny gnome's eyes reflect the light with a copper sheen. She is not what she seems.>\n\n$N! I have been waiting for you. The bronze dragonflight has need of your services.",
			}, -- [3]
			{
				["questid"] = 31015,
				["targetid"] = 61962,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "",
				["targetkind"] = "npc",
				["targetname"] = "Lorewalker Cho",
				["complete"] = "Ah! Now that that is done we can start to place your collected research here. I look forward to seeing what you find.",
			}, -- [4]
		}, -- [30]
		{
			{
				["date"] = "9^24^2014",
				["what"] = "login",
			}, -- [1]
			{
				["targetkind"] = "npc",
				["targetid"] = 60973,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "",
				["questid"] = 30480,
				["targetname"] = "Waterspeaker Gorai",
				["complete"] = "I see now that this ritual rips whatever was controlling the minds of these creatures from them. I now know what we must do.",
			}, -- [2]
			{
				["targetkind"] = "npc",
				["targetid"] = 61065,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "Is the lake cleansed?",
				["questid"] = 30828,
				["targetname"] = "Waterspeaker Gorai",
				["complete"] = "The Mere... I can feel the corruption clearing. At least now, this corruption will not spread.\r\n\r\nBut, there is one more thing we must do.",
			}, -- [3]
			{
				["targetkind"] = "npc",
				["targetid"] = 60973,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "",
				["questid"] = 30855,
				["targetname"] = "Waterspeaker Gorai",
				["complete"] = "Thank you, $N. You have assured that this corruption will not spread, and that my people - those who have not been corrupted - will be able to live on and found a new village. \r\n\r\nOur history will live on. You have done more for us than we could have ever hoped.\r\n\r\nThank you, friend.",
			}, -- [4]
			{
				["targetkind"] = "npc",
				["targetid"] = 63542,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "",
