		["quote"] = {
			["say"] = {
				["Try to stay alive! We are only just beginning our legendary journey."] = "",
				["I often venture out here to think. The view is breathtaking, would you agree?"] = "",
				["Let us see if your Alliance has what it takes to rule Azeroth."] = "",
				["Believe me - what Garrosh Hellscream achieved in Theramore is nothing compared to the horrors that are even now bearing down on our fragile home."] = "",
				["This war has to end. Soon. Before it consumes our strength!"] = "",
				["Finally, a gift from me. Make no mistake: the Black Dragonflight lives on!"] = "",
				["Sometimes I think it was the very precariousness of our world that drove my father to madness."] = "",
				["My father, Deathwing, tried to destroy the whole of Azeroth."] = "",
				["Very good. Let's talk."] = "",
				["Horde soldiers thundered across the realm in the wake of the devastation."] = "",
				["Tong! Something to eat, please."] = "",
				["The Terrace is just up the hill here. Stay on your guard; few visitors have returned."] = "",
				["Behold: The power of the foes you've vanquished."] = "",
				["Here! The embodiment of the fear that you've conquered. May it now strike terror into the hearts of your enemies!"] = "",
				["Allow me to gather up my things, and I will meet you there."] = "",
				["You have done great things, friend. I can assure you this is but the beginning of our work together."] = "",
				["He was misguided, of course, but he was right about one thing: Our world is... so fragile."] = "",
				["Let us see what he is truly made of."] = "",
				["Here's the bigger question: Can principles win a war?"] = "",
				["Is this because he is weak...? Or because he is principled?"] = "",
				["Suffering from amnesia, he fought for his life in Horde arenas."] = "",
				["Now, to my point: I believe we are headed towards a reckoning. And no, I am not talking about the current conflict between the Alliance and the Horde."] = "",
				["There. My work is done. You can now greatly augment the power of any sha-touched weapon."] = "",
				["Ah, thank you Tong."] = "",
				["Make no mistake. Pandaria will challenge your King."] = "",
				["We must ensure that you are up to the task... and then equip you accordingly."] = "",
				["And the wisdom of those you've outsmarted."] = "",
				["Pandaria is indeed a jewel. Such beauty. It makes you want to protect her, yes?"] = "",
